import { createMuiTheme} from "@material-ui/core/styles"
import orange from "@material-ui/core/colors/orange";


const themeNavInstructor = createMuiTheme({
    palette: {
        primary: {
            main: orange[200]
        },
        text: {
            primary: "#FFFF"
        }
    }
})

export default themeNavInstructor;
